// Single button component
const NumberButton = (props) => {    
    return (
        <input type="button" className="number-button button" value={props.number} />
    );
}


const showNumber = () =>{
    alert("value");
}


// All numbers in Keyboard component from min to max
const Keyboard = (props) => {    
    let numbers = [];
    for(let i = props.max; i >= props.min; i--) {
        numbers.push(i);
    }

    let keyboard = numbers.map(value => {
        //return <NumberButton number={value} onClick={showNumber} />
        return <NumberButton number={value} onClick={() => 
            alert("hola")
        } />
    })
    return (   
        <div className="keyboard-numbers calculator-section">
            {keyboard}
        </div>
    );
}


const Buttton = (props) => {    
    return (
        <input type="button" value={props.value}  onClick={props.onClick} />
    );
}


export default Keyboard;
export {showNumber, Buttton};
